import React from "react";

export default function Home(){
    return (
        <div>
            <h1>Welcome to my portfolio webpage!</h1>
            <img
                src="https://res.cloudinary.com/dow8www4d/image/upload/v1643308919/Webpage/portrait.jpg"
                height="275"
                width="193"
                className="rounded"
                alt=""
              />
            <p>Please excuse the appearance as this is a current work in progress. Feel free to become aquainted with me. I will be using this webpage as a central destination to showcase my work, experience, and projects.</p>
        </div>
    );
}
